# https://leetcode.com/problems/number-of-ways-to-split-a-string/
class Solution:
    def numWays(self, s: str) -> int:
        C1 = s.count('1')
        mod = 10 ** 9 + 7
        if C1 == 0:
            return (((len(s) - 2) * (len(s) - 1)) // 2) % mod
        if C1 % 3:
            return 0

        count0, count1 = [], 0
        i = 0
        while len(count0) < 2:
            while count1 != C1 // 3:
                if s[i] == '1':
                    count1 += 1
                i += 1
            start = i
            while s[i] != '1':
                i += 1
            end = i
            count0.append(end - start)
            count1 = 0
        return (count0[0] + 1) * (count0[1] + 1) % mod


s = Solution()
print(s.numWays("10101"))  # 4
print(s.numWays("1001"))  # 0
print(s.numWays("0000"))  # 3
print(s.numWays("00000"))  # 3
print(s.numWays("100100010100110"))  # 12
print(s.numWays(""))